import React from 'react';
import ReactDOM from 'react-dom';


const Message = () => {
    const name = <h1>'Jesse'</h1>;
    const age = 40;
    return name + ' is ' + age + 'years old.';
};
const Hello_comp = <Message />;
export default Hello_comp;
